/* eslint max-len: ["error", { "code": 120 }] */
import { Action, ActionCreator } from 'redux';
import {
  CREATE_PRODUCER,
  CREATE_PRODUCER_SUCCESS,
  CREATE_PRODUCER_ERROR,
} from '../actions';

export interface CreateProducerAction extends Action{
  type: 'CREATE_PRODUCER',
  payload: { user:any, history:any }
}
export interface CreateProducerSuccessAction extends Action{
  type: 'CREATE_PRODUCER_SUCCESS',
  payload: any
}
export interface CreateProducerErrorAction extends Action{
  type: 'CREATE_PRODUCER_ERROR',
  payload: { message:string }
}

export type ProcessAction = 

CreateProducerAction | CreateProducerSuccessAction | CreateProducerErrorAction;

export const createProducer:ActionCreator<CreateProducerAction> = (user, history) => ({
  type: CREATE_PRODUCER,
  payload: { user, history }
});
export const createProducerSuccess:ActionCreator<CreateProducerSuccessAction> = (user) => ({
  type: CREATE_PRODUCER_SUCCESS,
  payload: user
});
export const createProducerError:ActionCreator<CreateProducerErrorAction> = (message) => ({
  type: CREATE_PRODUCER_ERROR,
  payload: { message }
});
